import React, { Component } from "react";
import Image from 'react-bootstrap/Image'
import Container from 'react-bootstrap/Container'
import Col from 'react-bootstrap/Col'
import Row from 'react-bootstrap/Row'



import profile from './profile.jpg';


class About extends Component {
  render() {
    return (
      <Container className="about">
          <Row>
                <Col>
                <Image src={profile} rounded className="profile" alt='profile'/>
                </Col>
                <Col>
                <h3>My Story</h3>
                <p className = "bio">I am a junior at Brown University concentrating in Computer Science-Economics passionate about Software, Design and Product Management! Even though most of my past experiences are in software engineering and data, I have always been interested in design and decided to venture into it this semester! Outside of work catch me on the soccer field or watching a soccer game on a weekend morning!</p>
                </Col>
          </Row>


      </Container>
    );
  }
}

export default About;
